アコーディオン式<BR>
燃え難いカーテンです。<BR>
カラーはブラック、ブルー、ワイン、グリーン、パープルの６種類<BR><BR>
お客様ご使用サイズ：横2400mm×縦850mm<BR>
カーテンの実寸サイズ：横2750mm×縦850mm<BR>
カーテンフック付<BR><BR>
メーカー名：株式会社 雅<BR><BR>
