●ＤＣ12V／24V共用<BR>●ＵＳＢシガーライタープラグ付<BR>●搭載ＳＭＤＬＥＤ<BR>★ブルー/２個　★グリーン/２個　★レッド/２個<BR>※スイッチを押すたびにパターンが変化します！！<BR>※ほとんどのシフトノブに使用できますが、特に泡ノブとの相性はバツグンです。<BR>　フラッシュ点滅やグラデーション点灯など７パターンを組み込みました。<BR>　お好きなパターンでお楽しみ下さい。<style type="text/css">
<!--
body {
background-image:url(http://image.rakuten.co.jp/utamaroshop/cabinet/tokucyubanpa.jpg);
background-repeat:repeat-y;
background-position: right;
}
-->
</style>

★パンチング加工を施したレザーを　センター部分に採用することにより　抜群の通気性を実現！！
<BR><BR>
★快適な座り心地と疲労を和らげる　厚さ10mmの低反発ウレタンスポンジ　を採用！
<BR><BR>
★シート背面には雑誌や地図などが　収納できる便利なポケット付！
<BR><BR>
★背もたれ部・座面部が分割できるセパレート式！
<BR><BR>
●アームレストカバー付！
<BR><BR>

材質：PVC<BR>
適合車種： NEWギガ H19.4-H27.10<BR>
カラー：黒/赤糸<BR><BR>

メーカー名：株式会社ジェットイノウエ
